  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for South Carolina
  Sandhills Wildlife Refuge outlines Refuge accomplishments from November, 1939 through
  January, 1940. The report begins by summarizing the weather conditions during this
  period. Wildlife- including migratory birds, upland game birds, and predators- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include sharecropping.\",\n\t\"license_title\":
